import React from "react";
import { BsCurrencyDollar, BsCart } from "react-icons/bs";
import {
  TopHeading,
  Items,
  Logo,
  Menu,
  SingleIcon,
  DropDownContent,
  DropDownArrow,
} from "../../styles/topNav";

class TopNav extends React.Component {
  constructor(props: any) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <TopHeading>
          <Menu>
            <Items>WOMEN</Items>
            <Items>MEN</Items>
            <Items>KIDS</Items>
          </Menu>

          <Logo>Logo</Logo>

          <div>
            <SingleIcon data-badge="2">
              <BsCart />
            </SingleIcon>

            <SingleIcon>
              <BsCurrencyDollar />
              <DropDownContent>
                <li> $ USD </li>
                <li>&#8364; EUR </li>
                <li>&#165; JPY</li>
              </DropDownContent>
            </SingleIcon>
          </div>
        </TopHeading>
      </>
    );
  }
}

export default TopNav;
